import dynamic from "next/dynamic"
import { useState } from 'react'

const Rust = dynamic({
  loader: async () => {
    const rust = await import('../pkg')

    return (
      (props) => {
        rust.init_panic_hook

        const handleSubmit = (event) => {
          event.preventDefault()
          const b = event.target.elements.board.value.split(' ')
          const s = rust.solve(b)
          alert("mejor movimieto: " + s + ' ' + " Es array?: " + Array.isArray(b))
          event.target.reset();
        }

        return (
          <>
            <form onSubmit={handleSubmit}>
              <input name="board" type="text" />
            </form>
          </>
        )
      })
  },
})

export default Rust
